class Solution:
    def getVal(self, val, idx):
        if val == 0:
            return float('inf')
        else:
            return idx

    def modInsertionSort(self, arr):
        if len(arr) > 1:
            sortedIdx = 0
            curr = 1
            while curr < len(arr):
                if self.getVal(arr[sortedIdx], sortedIdx) <= self.getVal(arr[curr], curr):
                    sortedIdx = sortedIdx + 1
                    curr = curr + 1
                else:
                    smallerIdx = curr
                    smallerVal = arr[curr]
                    candidateIdx = sortedIdx
                    while candidateIdx >= 0 and self.getVal(arr[candidateIdx], candidateIdx) > self.getVal(smallerVal, smallerIdx):

                        arr[smallerIdx] = arr[candidateIdx]
                        candidateIdx = candidateIdx - 1
                        smallerIdx = smallerIdx - 1
                    arr[smallerIdx] = smallerVal
                    sortedIdx = sortedIdx + 1
                    curr = curr + 1

    def modSort(self, arr):
        global idx
        idx = -1

        def sortF(x):
            global idx
            idx = idx + 1
            return self.getVal(x, idx)

        arr.sort(key=sortF)

    def moveZeroes(self, nums):
        """
        :type nums: List[int]
        :rtype: void Do not return anything, modify nums in-place instead.
        """
        self.modSort(nums)

